import { NEW_GAME, USER_INPUT, LOSE_GAME } from '../actions/Actions';

const initialState = {
    victory : []
};


export default function reducer (state = initialState, action) {
    let nextState;
    switch (action.type) {
        default:
            return state;
    }
}
